export function overrideRadio(colors) {
    return {
        MuiRadio: {
            root: {
                padding: 12,
            },
            colorPrimary: {
                "&$checked": {
                    color: colors.primary.main,
                },
            },
            colorSecondary: {
                "&$checked": {
                    color: colors.secondary.main,
                },
            },
        },
    };
}
